import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faLightMagnifyingGlass} from '@fortawesome/free-solid-svg-icons';


function Search() {

    return(
        <form className="searchForm">
            <input className="searchInput" type="text" placeholder="nora를 검색해보세요"/>
            <button className="searchIcon"><FontAwesomeIcon icon="fa-light fa-magnifying-glass" /></button>
        </form>
    )
}
export default Search;
